import { createTheme } from "@mui/material";

const theme = createTheme({
  palette: {
    primary: {
      main: "#2da77a",
      light: "#E8F9F3",
      contrastText: "#FFFFFF",
    },
    text: {},
    secondary: {
      main: "#3D3D5E",
      contrastText: "FFFFFF",
    },
  },
});
export default theme;
